import React, { Component } from 'react';

export class About extends Component {
  render() {
    return (
      <div className="parafix"><br /><br /><br /><br /><br /><br />
        <h3>Our Mission:<br />
           To promote business and economic opportunities for the East Garden City community.<br />
           To be an advocate and resource for all member businesses that promote equality.<br />
           To promote revitalization with a unified approach by working with appropriate and related organizations.</h3>
      </div>
    );
  }
}

export default About;
